import './styles/home.css';

const Profile = () => {
  return (
    <div>
      <h3>Profile: Page</h3>
      <div class="profile">
        <img width="100px" height="150px" src="{}" alt="user's profile" />
      </div>
    </div>
  );
};
export default Profile;
